import { IconContext } from 'react-icons'
import { FaReact } from "react-icons/fa";
import { MdAlarm } from "react-icons/md";
import './App.css';

function App() {
  return (
    <IconContext.Provider value={{ color: 'blue' }}>
    <div className="App">
      <h1>This is Font Awesome Icon<FaReact color='purple' size='10rem' /></h1>
      <FaReact color='red' size='2rem'/>
      <h1>This is Material Design Icon</h1><MdAlarm color='orange' size='10rem' />
    </div>
    </IconContext.Provider>
  );
}

export default App;
